const fetchPost=(postId,password,callbackRight,callbackWrong,callbackNoPost,callbackError)=>{fetch("https://community.bhsjp.kro.kr/get-post",{method:"post",headers:{"Content-Type":"application/json"},body:JSON.stringify({postId:postId,password:password})}).then(res=>{return res.json()}).then(obj=>{switch(obj.result){case"right":callbackRight(obj.data);break;case"wrong":callbackWrong();break;case"no-post":callbackNoPost();break;case"error":callbackError();break}})};